require 'rails_helper'

RSpec.describe ImageIO, type: :model do
  let(:image) do
    ''
  end

  it 'generates a random filename' do
    filename = 'some_filename'
    expect(SecureRandom).to receive(:hex).and_return(filename)

    imageIO = ImageIO.new(image).setup
    expect(imageIO.original_filename).to eq('some_filename.png')
  end

  it 'set the content type to \'image/png\'' do
    imageIO = ImageIO.new(image).setup
    expect(imageIO.content_type).to eq('image/png')
  end

  it 'converts empty spaces to +' do
    image = 'a b c d '
    imageIO = ImageIO.new(image).setup

    expect(imageIO.read).to eq(Base64.decode64('a+b+c+d+'))
  end
end
